namespace Avalonia.schoolTimetabler.Models;public record SchoolClass(string Number, string Symbol, string Classroom){    public SchoolClass(global::Data.Models.SchoolClass dbSchoolClass) : this(dbSchoolClass.Number, dbSchoolClass.Symbol, dbSchoolClass.Classroom)    {            }    public global::Data.Models.SchoolClass MapToDbSchoolClass()    {        return new global::Data.Models.SchoolClass(Classroom: this.Classroom, Number: this.Number, Symbol: this.Symbol);    }}